// Wrap your code in an event listener for DOMContentLoaded
document.addEventListener('DOMContentLoaded', function() {
  // Check if the user agent contains the word "Safari" and is not Chrome or other browsers
  if (navigator.userAgent.indexOf('Safari') != -1 && navigator.userAgent.indexOf('Chrome') == -1) {
    // Add the 'is-safari' class to the body element
    document.body.classList.add('is-safari');
  }
});

/*!
 * Scaled text for Matrix Themes and Matrix Page Builder
 * @version 1.0.4
 * licensed under MIT
 */

document.addEventListener('DOMContentLoaded', function() {
  // Get all the parent div elements with the classes 'j-text', 'is-scaled', 'is-fluid'
  const parentDivs = document.querySelectorAll('.j-text, .is-fluid, .is-scaled');

  // Loop through each parent div and set the font size of all the text span elements inside it
  function setFontSizes() {
parentDivs.forEach(function(parentDiv) {
  const textSpans = parentDiv.querySelectorAll('span');
  if (textSpans.length > 0) {
    const parentWidth = parentDiv.offsetWidth;
    textSpans.forEach(function(textSpan) {
      const currentFontSize = parseFloat(window.getComputedStyle(textSpan).fontSize);
      const initialFontSize = parseFloat(textSpan.style.fontSize);
      let fontSize = Math.floor(parentWidth / 10); // Adjust this factor to control the scaling
      fontSize = Math.max(fontSize, 50); // set minimum font size to 50px
      if (currentFontSize > 50) {
        if (fontSize > initialFontSize) {
          fontSize = initialFontSize;
        }
        textSpan.style.fontSize = `${fontSize}px`;
        textSpan.style.wordBreak = "break-word"; // Add this line to enable breaking long words
      }
    });
  }
});
}

  // Call the setFontSizes function initially to set the font size of the text for all instances
  setTimeout(setFontSizes, 0);

  // Call the setFontSizes function whenever the window is resized to adjust the font size for all instances
  window.addEventListener('resize', setFontSizes);
});



// paste function of the plain text inside the style editor
// Get all <td> elements with the class name "color-switcher"
var tds = document.querySelectorAll(".color-switcher");

// Loop through each <td> element and add a paste event listener
tds.forEach(function(td) {
  td.addEventListener("paste", function(event) {
    // Prevent the default paste behavior
    event.preventDefault();

    // Get the pasted text content
    var text = event.clipboardData.getData("text/plain");

    // Append the stripped text to the existing text in the <td> element
    td.innerText += text;
  });
});



// Border radius function for fluid sections
function increaseBorderRadius(button) {
  let parentDiv = button.closest('.is-fluid');
  let image = parentDiv.querySelector('img');
  let fluidDiv = parentDiv.querySelector('.fluid-bg');

  if (image) {
    let currentRadius = parseInt(image.style.borderRadius || 0);
    currentRadius += 10; // You can adjust the increment as needed
    image.style.borderRadius = currentRadius + "px";
    image.setAttribute("data-mce-style", "border-radius: " + currentRadius + "px;");
  }

  if (fluidDiv) {
    let currentRadius = parseInt(fluidDiv.style.borderRadius || 0);
    currentRadius += 10; // You can adjust the increment as needed
    fluidDiv.style.borderRadius = currentRadius + "px";
    fluidDiv.setAttribute("data-mce-style", "border-radius: " + currentRadius + "px;");
  }
}

function decreaseBorderRadius(button) {
  let parentDiv = button.closest('.is-fluid');
  let image = parentDiv.querySelector('img');
  let fluidDiv = parentDiv.querySelector('.fluid-bg');

  if (image) {
    let currentRadius = parseInt(image.style.borderRadius || 0);
    currentRadius -= 10; // You can adjust the decrement as needed
    if (currentRadius < 0) {
      currentRadius = 0;
    }
    image.style.borderRadius = currentRadius + "px";
    image.setAttribute("data-mce-style", "border-radius: " + currentRadius + "px;");
  }

  if (fluidDiv) {
    let currentRadius = parseInt(fluidDiv.style.borderRadius || 0);
    currentRadius -= 10; // You can adjust the decrement as needed
    if (currentRadius < 0) {
      currentRadius = 0;
    }
    fluidDiv.style.borderRadius = currentRadius + "px";
    fluidDiv.setAttribute("data-mce-style", "border-radius: " + currentRadius + "px;");
  }
}

// change image URL in fluid sections
function openImageURLPopup(button) {
  const image = button.nextElementSibling; // Target the next sibling (the img element)
  const currentURL = image.src;
  const currentAlt = image.alt;
  const dataMceSrc = image.getAttribute("data-mce-src"); // Get the data-mce-src attribute

  let newURL = prompt(`Current URL: ${currentURL}\nCurrent Alt Text: ${currentAlt}\n\nEnter the new image URL (or leave it blank to keep the current image):`, currentURL);

  if (newURL !== null) {
      newURL = newURL.trim(); // Remove leading/trailing whitespace
  }

  if (newURL !== null && newURL !== "") {
      image.src = newURL; // Update the image URL
      image.setAttribute("data-mce-src", newURL); // Update the data-mce-src attribute
  } else if (newURL === null || newURL === "") {
      // If a new URL is not provided or is left blank, prompt for alt text
      let newAlt = prompt(`Current URL: ${currentURL}\nCurrent Alt Text: ${currentAlt}\n\nEnter the new alt text for the image (or leave it blank to keep the current alt text):`, currentAlt);

      if (newAlt !== null) {
          newAlt = newAlt.trim(); // Remove leading/trailing whitespace
          image.alt = newAlt; // Update the alt text
      }
  } else {
      console.error("Editable image not found.");
  }
}


// Function to change background image URL in editable-img sections
function openBackgroundImageURLPopup(button) {
  const parentDiv = button.closest('.editable-bg-image');

  if (!parentDiv) {
    console.error("Editable image not found.");
    return;
  }

  const backgroundStyle = parentDiv.style.backgroundImage;
  const backgroundImageURLMatch = /url\(['"]?(.*?)['"]?\)/.exec(backgroundStyle);

  if (!backgroundImageURLMatch) {
    console.error("Background image URL not found.");
    return;
  }

  const currentBackgroundURL = backgroundImageURLMatch[1];

  let newURL = prompt(`Current Background URL: ${currentBackgroundURL}\n\nEnter the new background image URL (or leave it blank to keep the current image):`, currentBackgroundURL);

  if (newURL !== null) {
    newURL = newURL.trim();
  }

  if (newURL !== null && newURL !== "") {
    // Update both inline style and data-mce-style
    parentDiv.style.backgroundImage = `url('${newURL}')`;
    parentDiv.setAttribute('data-mce-style', `background: url('${newURL}')`);
  } else {
    console.error("No valid new background image URL provided.");
  }
}
 



